import styled from "styled-components";

export const TableViewRoot = styled.div`
  .row {
    display: flex;
  }

  .cell,
  .headerCell {
    flex-grow: 1;
    background-color: #1e1e1b;
    padding: 10px;
    font-weight: normal;
    border-radius:1px;
  }
`;

export const NoWrapCell = styled.td``;
